class Solution {

    /**
     * @param Integer[] $nums
     * @return Boolean
     */
    function hasTrailingZeros($nums) {
        // Iterate through each bit position (0 to 6, because 2^7 > 100)
        for ($i = 0; $i <= 6; $i++) {
            $allZeros = true;

            // Check if all numbers have a zero in this bit position
            foreach ($nums as $num) {
                if (($num & (1 << $i)) !== 0) {
                    $allZeros = false;
                    break;
                }
            }

            // If all numbers have a zero in this bit position, return true
            if ($allZeros) {
                return true;
            }
        }

        // No bit position was found where all numbers have a zero
        return false;
    }
}
